(window.webpackJsonp=window.webpackJsonp||[]).push([[1495],{1849:function(n,h,i){"use strict";i.r(h);var t=i(44),g=Object(t.a)({},(function(){var n=this,h=n.$createElement,i=n._self._c||h;return i("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[i("h1",{attrs:{id:"chuong-268-tien-vao-san"}},[i("a",{staticClass:"header-anchor",attrs:{href:"#chuong-268-tien-vao-san"}},[n._v("#")]),n._v(" Chương 268: Tiến vào sân")]),n._v(" "),i("hr"),n._v(" "),i("p",[i("br"),i("br"),n._v("Từ khi ba năm trước, tu luyện xảy ra vấn đề, mỗi đến tối, hắn cũng có gấp gáp thở khò khè, như là được người bóp lấy cái cổ, bị dằn vặt không rõ sống chết."),i("br"),i("br"),n._v("Bệnh này chứng từng chuyên môn tìm y sư xem qua, bất luận nhị tinh vẫn là tam tinh, cũng không tìm tới nguồn bệnh, mở ra không ít thuốc dùng, kết quả đều không quá to lớn công hiệu."),i("br"),i("br"),n._v("Vốn tưởng rằng đời này đều sẽ ở loại bệnh này đau bị hành hạ, mãi đến tận cuối đời, không nghĩ tới trước mắt cái này xem ra không thế nào nhất tinh y sư, một ngụm nói ra."),i("br"),i("br"),n._v("Lẽ nào hắn xem ra chỉ là một cái nhất tinh y sư, mà trên thực tế nhưng là một vị cao thủ?"),i("br"),i("br"),n._v("“Không biết vị y sư này xưng hô như thế nào?”"),i("br"),i("br"),n._v("Ngăn cản lại muốn muốn động thủ rất nhiều hộ vệ, Lộ quản gia đè nén khiếp sợ trong lòng, khom người nói."),i("br"),i("br"),n._v("“Thiên Vũ vương quốc, Bạch Thiềm!”"),i("br"),i("br"),n._v("Trương Huyền lạnh nhạt nói."),i("br"),i("br"),n._v("“Hóa ra là Bạch Thiềm y sư, có thể hay không mượn một bước nói chuyện?”"),i("br"),i("br"),n._v("Của hắn thở khò khè bệnh, người biết không nhiều, không muốn huyên náo toàn thành đều biết."),i("br"),i("br"),n._v("“Xin mời!” Trương Huyền gật đầu."),i("br"),i("br"),n._v("“Ây...”"),i("br"),i("br"),n._v("Tình cảnh này, Mạc Vũ tất cả nhìn ở trong mắt, một đôi tú mục trừng tròn xoe, sắp rơi trên mặt đất."),i("br"),i("br"),n._v("Giờ khắc này, có ngốc nàng cũng biết, Trương Huyền nói “Thở khò khè” khẳng định là đúng, bằng không, vị này Lộ quản gia tuyệt đối sẽ không lập tức thay đổi thái độ."),i("br"),i("br"),n._v("Không dùng hỏi dò, không dùng quan sát, đánh một quyền liền nhìn ra chứng bệnh..."),i("br"),i("br"),n._v("Chẩn đoán bệnh man thú phương pháp chẩn đoán bệnh người, còn một hồi thành công..."),i("br"),i("br"),n._v("Thế nào cảm giác không thể tin được đâu?"),i("br"),i("br"),n._v("Người khác có thể sẽ cảm thấy vị này Trương Huyền, sớm điều tra Lộ quản gia tình huống thân thể, cố ý vào lúc này nói ra, nàng cũng hiểu được, cái tên này trước liền Đại Dược Vương cũng không biết, một cái nho nhỏ quản gia lại làm sao có khả năng biết được?"),i("br"),i("br"),n._v("Khẳng định là vừa mới chẩn đoán được đến."),i("br"),i("br"),n._v("Dùng đánh tơi bời thu phục man thú, dùng chỉ điểm tiến hành luyện đan, dùng đánh quyền làm cho người ta xem bệnh, sớm biết cái tên này không đi bình thường đường, có thể chuyện này... Cũng quá không đi bình thường đường đi!"),i("br"),i("br"),n._v("“Qua xem một chút!”"),i("br"),i("br"),n._v("Chấn kinh rồi một hồi, lúc này mới phát giác, hai người từ lâu đi vào sân, lúc này mới vội vội vàng vàng đi theo."),i("br"),i("br"),n._v("Gặp Lộ quản gia ra lệnh, hộ vệ cũng không dám ngăn trở."),i("br"),i("br"),n._v("“Tuy rằng không biết cái tên này dựa vào đánh quyền, làm thế nào nhìn ra được chứng bệnh, nhưng giải quyết không được, vẫn là vô dụng!”"),i("br"),i("br"),n._v("Mạc Vũ tâm như gương sáng."),i("br"),i("br"),n._v("Hồng Liên thành, làm Thiên Vũ chung quanh mười hai cái vương quốc to lớn nhất dược liệu sàn giao dịch chỗ, trong đó đến đây dược sư đếm không xuể, Lộ quản gia thân mắc bệnh kín, làm sao có khả năng không tìm người trị liệu?"),i("br"),i("br"),n._v("Liền một ít nhị tinh, tam tinh y sư đều trị liệu không được, nàng cũng không tin, vị này Trương Huyền nhìn một chút, liền có thể triệt để chữa khỏi."),i("br"),i("br"),n._v("Âm thầm suy đoán, đi vào viện, đang suy nghĩ Trương Huyền nhìn ra chứng bệnh không trị hết làm sao bây giờ, liền gặp trước tiến vào hai người, đứng ở cách đó không xa."),i("br"),i("br"),n._v("Chỉ nhìn lướt qua, thân thể liền không tự chủ được đánh cái lảo đảo, suýt chút nữa không tại chỗ ngất đi."),i("br"),i("br"),n._v("Chỉ thấy vừa muốn mượn một bước nói chuyện Lộ quản gia, lúc này chính một mặt cung kính đứng ở Trương Huyền trước mặt, khác nào một học sinh, trong mắt tràn ngập kích động cùng kịch liệt."),i("br"),i("br"),n._v("“Chuyện này...”"),i("br"),i("br"),n._v("Mạc Vũ dùng sức vuốt mắt, chỉ lo nhìn lầm."),i("br"),i("br"),n._v("Bản thân không lưu lại bao lâu liền theo tới, cùng đối phương bên trong bên ngoài không vượt qua một phút, vừa nãy Lộ quản gia còn khí thế hùng hổ, một mặt tức giận, làm sao thời gian nháy mắt liền biến thành dáng vẻ ấy?"),i("br"),i("br"),n._v("Nếu không là địa bên trên không nằm người, nàng thật hoài nghi có phải là cái tên này càng làm người đánh ngất, sử dụng ngụy trang nghề nghiệp."),i("br"),i("br"),n._v("Đang muốn đi tới, hỏi cho ra nhẽ, liền gặp Trương Huyền vung vung tay, tràn đầy thiếu kiên nhẫn: “Được rồi, dẫn ta đi gặp Đại Dược Vương đi!”"),i("br"),i("br"),n._v("Mạc Vũ một cái lảo đảo."),i("br"),i("br"),n._v("Thiếu kiên nhẫn?"),i("br"),i("br"),n._v("Ngươi có cái gì thiếu kiên nhẫn?"),i("br"),i("br"),n._v("Nơi này là Đại Dược Vương phủ đệ, đối với bọn họ quản gia thiếu kiên nhẫn, ngươi liền không sợ bị đánh chết tươi?"),i("br"),i("br"),n._v("Vốn cho là hắn loại thái độ này, Lộ quản gia nhất định sẽ mặt lộ vẻ không vui, lại người sau khom người chào, thái độ cung kính khác nào thấy cha mẹ: “Vâng, mời tới bên này, ta vậy thì dẫn ngươi đi gặp Đại Dược Vương!”"),i("br"),i("br"),n._v("Mạc Vũ lại lần nữa loáng một cái, cảm thấy cả người đều có chút không tốt."),i("br"),i("br"),n._v("Đến cùng làm sao?"),i("br"),i("br"),n._v("Coi như vạch ra ngươi thân mắc chứng bệnh, cũng không đến mức như vậy đi?"),i("br"),i("br"),n._v("Nhìn ra chứng bệnh và giải quyết, là hai chuyện khác nhau, không giải quyết tựu cái này dạng, ngươi cũng quá không cốt khí đi!"),i("br"),i("br"),n._v("Thầm nhủ trong lòng, thực sự không nhịn được, vài bước đi tới Trương Huyền trước mặt, lặng lẽ truyền âm."),i("br"),i("br"),n._v("“Đây rốt cuộc xảy ra chuyện gì? Lộ quản gia thái độ, làm sao...”"),i("br"),i("br"),n._v("“Há, thân thể hắn có vấn đề, ta mới vừa giúp hắn chữa khỏi!”"),i("br"),i("br"),n._v("Trương Huyền âm thanh truyền tới."),i("br"),n._v(" “Trị... Chữa khỏi?” Mạc Vũ thân thể mềm mại cứng đờ, đầu choáng váng."),i("br"),i("br"),n._v("Liền so với nàng sớm tiến viện một phút, liền chữa khỏi đối phương bệnh?"),i("br"),i("br"),n._v("Ngươi không có nói đùa chớ?"),i("br"),i("br"),n._v("“Hắn cái kia không phải bệnh, chỉ là trúng độc mà thôi, ta giúp hắn trừ độc, đương nhiên cảm kích mang đức.” Nhìn ra nàng nghi hoặc, Trương Huyền giải thích."),i("br"),i("br"),n._v("Cái này Lộ quản gia, nửa đêm thở khò khè, cũng không phải là tu luyện xảy ra sai sót, mà là được người lặng lẽ hạ độc."),i("br"),i("br"),n._v("Loại độc chất này, phi thường quái lạ, coi như tam tinh y sư cũng nhìn không ra đến, vì lẽ đó rất khó chữa trị."),i("br"),i("br"),n._v("Bất quá, hắn không giống, Thiên Đạo chân khí vừa ra, loại này cấp bậc độc khí, có thể đơn giản bức ra ngoài thân thể, mấy hơi thở liền trị liệu xong xuôi, một phút, dư dả."),i("br"),i("br"),n._v("“Trúng độc? Trừ độc?”"),i("br"),i("br"),n._v("Nghe hắn nói đơn giản, một bên Mạc Vũ đầy mặt rung mạnh."),i("br"),i("br"),n._v("Trừ độc, so chữa bệnh càng khó!"),i("br"),i("br"),n._v("Bằng không, độc sư cũng không đến mức để vô số người nghe đến đã biến sắc, tâm thấy sợ hãi."),i("br"),i("br"),n._v("Lại nói, chỉ có chân chính độc sư mới có thể làm đến làm cho người ta trừ độc, giải quyết trong cơ thể lưu giữ độc khí... Ngươi không phải đối với độc không biết, liền Độc điện ở nơi nào cũng không biết sao?"),i("br"),i("br"),n._v("Khi nào có thể trừ độc?"),i("br"),i("br"),n._v("Vốn là nghĩ, đem Trương Huyền mang tới đây, trở về Thiên Vũ vương thành, lúc này lại với trước mắt người thanh niên này, càng ngày càng hiếu kỳ, muốn phải tiếp tục theo nhìn xuống, cái tên này đến cùng còn có thể sáng chế ít nhiều khiến người khó có thể tin thần thoại."),i("br"),i("br"),n._v("..."),i("br"),i("br"),n._v("Không để ý tới sắc mặt lúc đỏ lúc trắng không biết nghĩ cái gì Mạc Vũ, Trương Huyền đi theo Lộ quản gia phía sau, lặng lẽ quan sát bốn phía."),i("br"),i("br"),n._v("Khó trách trước vị công chúa này nói, rất khó ẩn vào đến, giờ khắc này nhìn một hồi mới biết, đây là thật sự."),i("br"),i("br"),n._v("Toàn bộ phủ đệ con đường rắc rối phức tạp không nói, càng là che kín trạm gác, những hộ vệ này phần lớn đều có Ích Huyệt cảnh tu vi, lợi hại thống lĩnh, càng là đạt đến Thông Huyền cảnh đỉnh phong."),i("br"),i("br"),n._v("Không chỉ có như vậy, còn tại viện một ít xó xỉnh nhìn thấy trận kỳ, trận cơ, không cần nghĩ, không chỉ có tu vi cao thâm hộ vệ, còn có trận pháp phong tỏa bốn phía, không biết cụ thể bố trí cùng phương vị, một khi rơi vào trong đó, rất có thể có thể bị nhốt lại, nghĩ ra được đều rất khó."),i("br"),i("br"),n._v("Hộ vệ, trận pháp chỉ là ở bề ngoài có thể nhìn thấy, vị này Đại Dược Vương nếu cùng Độc điện quan hệ mật thiết, làm sao có khả năng không có kịch độc?"),i("br"),i("br"),n._v("Vì lẽ đó, dù cho thực lực không kém, muốn lẻn vào cái nhà này, cũng hầu như không thể."),i("br"),i("br"),n._v("Có quản gia dẫn đường, một đường thông suốt không trở ngại, thời gian không lâu, liền đến đến một cái rộng rãi đại điện."),i("br"),i("br"),n._v("Đi vào trong đó, bên trong đã ngồi không dưới mười mấy vị người trung niên, ông lão, mỗi cái trước ngực đều mang theo huy chương."),i("br"),i("br"),n._v("Chỉ liếc mắt nhìn, Trương Huyền liền âm thầm líu lưỡi."),i("br"),i("br"),n._v("Đều đang là nhị tinh cùng với trở lên y sư, còn có ba vị, lại đã đạt tới tam tinh."),i("br"),i("br"),n._v("Tam tinh y sư, coi như tại nhất đẳng vương quốc, cũng là đứng đầu nhất tồn tại, có thể ở đây tụ tập ba vị, không thể không nói, vị này Đại Dược Vương mặt mũi còn thật là lớn."),i("br"),i("br"),n._v("“Lộ quản gia, không phải yêu cầu nhị tinh trở lên mới có thể đi vào sao? Ngươi mang một cái nhất tinh y sư tới đây làm gì?”"),i("br"),i("br"),n._v("Nhìn thấy Trương Huyền đi tới, một cái tam tinh y sư không nhịn được hơi nhướng mày."),i("br"),i("br"),n._v("“Này không phải Bạch Thiềm y sư sao? Nơi này không phải ngươi nên đến địa phương, đuổi mau đi ra đi!”"),i("br"),i("br"),n._v("Lại một cái y sư nhận ra Trương Huyền, hừ nói."),i("br"),i("br"),n._v("“Mộc Hoành y sư, Thành Phong y sư, vị này Bạch Thiềm y sư, tuy rằng chỉ là nhất tinh, đối với y đạo lý giải nhưng là không thấp, vì lẽ đó, ta đem hắn mời lại đây.” Thấy hai người xem thường, Lộ quản gia vội vàng giải thích."),i("br"),i("br"),n._v("“Đối với y đạo lý giải không thấp? Lộ quản gia, ngươi đùa giỡn chứ?”"),i("br"),i("br"),n._v("Nhận ra Trương Huyền Thành Phong y sư nhẹ nhàng nở nụ cười, hừ một tiếng: “Ta cùng hắn ở chung không dưới hai mươi năm, cái gì trình độ có thể không biết?”"),i("br"),i("br"),n._v("Bạch Thiềm y sư tuy rằng chỉ là cái nhất tinh y sư, tại Thiên Vũ vương quốc y sư công hội, nhưng là rất nổi danh, tham tài háo sắc, trải qua không ít chuyện hoang đường, đã từng suýt chút nữa bị thủ tiêu y sư tư cách, nếu không là thời khắc mấu chốt, chó ngáp phải ruồi, khả năng liền nhất tinh huy chương đều không tại người lên."),i("br"),i("br"),n._v("Lộ quản gia lại còn nói người như thế đối với y đạo lý giải không thấp... Chuyên môn mời mời đi theo..."),i("br"),i("br"),n._v("“Lộ quản gia, lần này ngươi khẳng định là nhìn nhầm!”"),i("br"),i("br"),n._v("“Cái tên này ta cũng nhận thức, trở thành một tinh y sư đều rất mặt tường, còn lý giải không thấp? Mời lại đây?”"),i("br"),i("br"),n._v("“Tuyệt đối đừng bị cái tên này lời chót lưỡi đầu môi lừa...”"),i("br"),i("br"),n._v("Trong đám người không ít biết chuyện này, đồng thời nhận thức Bạch Thiềm, tất cả đều lộ ra khinh bỉ tâm ý."),i("br"),i("br"),n._v("Một cái không có gì bản lĩnh, chỉ có thể mua dược liệu, không dám cho người xem bệnh nhất tinh y sư mà thôi, khi nào trở thành cao thủ?"),i("br"),i("br"),n._v("“Hắn...”"),i("br"),i("br"),n._v("Nghe được lời của mọi người, Lộ quản gia cũng là sững sờ, hiển nhiên, hắn cũng không ngờ tới vị này ung dung giải quyết ngoan bệnh lợi hại y sư, tiếng tăm kém như vậy."),i("br"),i("br"),n._v("Đang muốn thay hắn giải thích vài câu, trong đám người một cái tam tinh y sư, bàn tay lớn vẫy một cái, ngắt lời hắn."),i("br"),i("br"),n._v("“Được rồi, quản hắn nhất tinh, nhị tinh, chỉ cần một lúc nữa ngậm kín miệng, đừng nói nhảm là được. Chúng ta tới nơi này là vì chữa bệnh, Lộ quản gia, mọi người đến nhiều như vậy, có phải là nên mang chúng ta đi gặp Đại Dược Vương?”"),i("br"),i("br"),n._v("“Vâng, ta hiện tại liền đem lão gia mời đi theo, để mọi người trị liệu!”"),i("br"),i("br"),n._v("Nghe được mọi người không ở truy cứu, sắp xếp Trương Huyền ngồi ở một bên, Lộ quản gia lúc này mới liền vội vàng gật đầu."),i("br"),i("br"),n._v("(Khặc khặc, viết 1,500 chữ, cảm thấy không đúng, xóa viết lại, vì lẽ đó chậm chút. Thật không tiện a! Buổi chiều hẳn là bảy giờ đúng giờ!)"),i("br"),i("br"),n._v("Convert by: ThấtDạ"),i("br"),i("br"),i("br"),i("br")]),n._v(" "),i("hr"),n._v(" "),i("p",[i("a",{attrs:{href:"./chap-276"}},[n._v("Chương trước")]),n._v("  |  "),i("a",{attrs:{href:"./chap-278"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);